INSERT INTO `intolerancia` VALUES (1,'Intolerancia a la fructosa','Evitar frutas con alto contenido de fructosa, miel, y productos procesados con jarabe de maíz alto en fructosa.','/icons/fructosa.svg','Consulta con un especialista para una dieta adecuada.','Fructosa'),(2,'Alergia a los frutos secos','Evitar nueces, almendras, avellanas, anacardos, pistachos y cualquier alimento que pueda contener trazas.','/icons/frutosecos.svg','Revisar etiquetas y evitar contaminación cruzada.','Frutos secos'),(3,'Intolerancia al gluten','Evitar trigo, cebada, centeno y alimentos procesados que los contengan.','/icons/gluten.svg','Busca productos certificados sin gluten.','Gluten'),(4,'Alergia o intolerancia a los huevos','Evitar huevos en todas sus formas y alimentos que los contengan (pasteles, salsas, pastas).','/icons/huevos.svg','Usar sustitutos como semillas de chía o linaza.','Huevos'),(5,'Intolerancia a la lactosa','Evitar leche y derivados como yogur, queso o helados no deslactosados.','/icons/lactosa.svg','Optar por productos sin lactosa o vegetales.','Lactosa'),(6,'Alergia a los mariscos','Evitar camarones, langostinos, cangrejo, mejillones, y otros mariscos.','/icons/mariscos.svg','Precaución con platos preparados en restaurantes.','Mariscos'),(7,'Intolerancia o alergia a la soja','Evitar productos como tofu, salsa de soja, leche de soja, y alimentos industrializados que contengan soja.','/icons/soja.svg','Lee siempre las etiquetas de ingredientes.','Soja'),(8,'Dieta vegana','Exclusión total de productos de origen animal como carne, leche, huevos y miel.','/icons/veganos.svg','Busca productos etiquetados como 100% vegetales.','Veganos');
/*!40000 ALTER TABLE `intolerancia` ENABLE KEYS */;
